    years.forEach(function (year, index){
        console.log(year, index);
        options.push(<option value={year}>{year}</option>);
       });

   
   return (<form>
        <select name='year' id='year'>
         {options}
        </select>
    </form>
    )
};

export default ExpenseFilter;
